<!DOCTYPE html>
<html>
  <head>
    <title>JupyterLite</title>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <link
      id="jupyter-lite-main"
      rel="preload"
      href="../build/lab/bundle.js?_=c5f95d0"
      main="index"
      as="script"
    />
    <meta name="theme-color" content="#000000">
    <link rel="manifest" href="../pwas/manifest.json">
    <link rel="apple-touch-icon" href="../pwas/image/512.png">
    <script src="../pwas/app.js"></script>
    <script
      id="jupyter-config-data"
      type="application/json"
      data-jupyter-lite-root=".."
    >
      {}
    </script>
    <script>
      (async function () {
        const { pathname, origin, search, hash } = window.location;
        if (pathname.match(/(index.html|\/)$/) == null) {
          window.location.href = `${origin}${pathname}/${search}${hash}`;
          return;
        }
        await import(
          '../config-utils.js?_=c5f95d0'
        );
      }.call(this));
    </script>
  </head>
</html>
